    "["Use Constraints: Because the source bathymetric and topographic data vary in
    density and accuracy, users need to be made aware of the spatially varying quality
    of the merged model. In some areas, the spacing of the soundings would support gridding
    at a much higher resolution than 1-arc second, where in other areas the values of
    the 1-arc-second grid were interpolated based only on distant points. Likewise,
    the vertical accuracy of the model varies spatially, due mainly to the wide variety
    of dates and data collection technologies used for source data acquisition. A merged
    raster model at a uniform grid cell spacing was produced because most users require
    such a product for their computer mapping systems.", "Access Constraints: None"]"nt},nt{ntt"key":
